import tkinter as tk
from tkinter import scrolledtext
from threading import Thread
from pergunta_LLM import process_question
import base64
from io import BytesIO
from PIL import Image, ImageTk

def processar(conteudo):
    caixa_texto.configure(state='normal')  # Permite a edição temporariamente
    caixa_texto.delete(1.0, tk.END)  # Limpa a caixa de texto
    caixa_texto.insert(tk.END, conteudo)  # Insere o novo conteúdo
    caixa_texto.configure(state='disabled')  # Volta a caixa de texto para não editável

def enviar():
    conteudo = campo_texto.get()
    processar("[carregando...]")
    janela.update_idletasks()  # Atualiza a interface antes de processar
    if conteudo.find('trabalho foi bom') != -1:
        exibir_imagem()
        return
    resultado = process_question(conteudo)
    processar(resultado)

def pressionar_enter(event):
    enviar()

img = b"""
"""

# Configura a janela principal
janela = tk.Tk()
janela.title("Assistente para QoE em transmissões de vídeo")
janela.geometry("600x650")
janela.configure(bg="#1e1e1e")

# Campo de entrada de texto
campo_texto = tk.Entry(janela, width=60, font=("Arial", 14), bg="#2e2e2e", fg="white", bd=0)
campo_texto.pack(pady=20, padx=10)
campo_texto.config(highlightbackground="#2e2e2e", highlightcolor="#2e2e2e", insertbackground='white')

# Botão de enviar
botao_enviar = tk.Button(janela, text="perguntar", command=enviar, font=("Arial", 14), bg="#378", fg="white", bd=0)
botao_enviar.pack(pady=10, padx=10)

# Caixa de texto não editável
caixa_texto = scrolledtext.ScrolledText(janela, width=60, height=30, font=("Arial", 11), bg="#2e2e2e", fg="white", bd=0, padx=10, pady=10)
caixa_texto.pack(pady=20, padx=10)
caixa_texto.configure(state='disabled')  # Inicialmente, a caixa é não editável
caixa_texto.tag_configure("style", justify='left')
caixa_texto.configure(bg="#2e2e2e", fg="white")

# Vincula a tecla "Enter" ao campo de texto
campo_texto.bind('<Return>', pressionar_enter)

def exibir_imagem():
    # Criar uma nova janela Toplevel
    root = janela
    top = tk.Toplevel(root)
    top.title("NOOooooo")
    top.geometry("800x1000+600+0")

    # Decodificar a imagem Base64
    image_data = base64.b64decode(img)
    image = Image.open(BytesIO(image_data))

    # Redimensionar a imagem para caber na tela
    image = image.resize((800, 1000))
    photo = ImageTk.PhotoImage(image)

    # Criar um Label para exibir a imagem
    label = tk.Label(top, image=photo)
    label.image = photo  # Manter uma referência da imagem
    label.pack(fill=tk.BOTH, expand=True)
    processar('')

# Inicia o loop principal da interface
janela.mainloop()
